import UserItem from "../UserItem/UserItem";
import notFoundImage from '../../images/not-found-image.jpg'

const UserList = ({users}) => { 

    const usersNotFound = !users;
    const usersIsEmpty = users.length = 0;
    const usersFull = users;

    return(
        <ul>
            {!users && <>
            <img src={notFoundImage} alt=""/>
            <p>{users.length}</p>
            </>}

            {users && users.map(({id, email, name, phone, photo, position}) => (
                <UserItem 
                    key={id} 
                    email={email} 
                    name={name}
                    phone={phone} 
                    photo={photo} 
                    position={position}
                />
            ))}
        </ul>
    )
}

export default UserList;
